        public const string assignmentFetchXml = @"<fetch version='1.0'  no-lock='true'>
  <entity name='cdcep_volunteerassignment'>
    <attribute name='cdcep_volunteerassignmentid' />
    <attribute name='cdcep_name' />
    <attribute name='createdon' />
    <attribute name='ownerid' />
    <attribute name='cdcep_volunteerid' />
    <attribute name='cdcep_facilityid' />
    <attribute name='cdcep_organization_id' />
    <order attribute='cdcep_volunteerid' descending='false' />
    <filter type='and'>
      <condition attribute='statecode' operator='eq' value='0' />
      <condition attribute='cdcep_lasttimeentrydate' operator='null' />
      <condition attribute='cdcep_facilityid' operator='eq' value='00001000-0000-0001-0000-000000000033' />
    </filter>
    <link-entity name='contact' from='contactid' to='cdcep_volunteerid' link-type='inner' alias='ae'>
      <filter type='and'>
        <condition attribute='statecode' operator='eq' value='0' />
      </filter>
    </link-entity>
  </entity>
</fetch>";

        public const string timeEntryFetchxml = @"<fetch version='1.0'   no-lock='true' >
  <entity name='msnfpe_timeentry'>
    <attribute name='msnfpe_date' />
    <filter type='and'>
      <condition attribute='msnfpe_date' operator='on-or-after' value='{1}' />
      <condition attribute='msnfpe_date' operator='on-or-before' value='{2}' />
      <condition attribute='cdcep_assignment_id' operator='eq' value='{0}' />
    </filter>
  </entity>
</fetch>";

        public const string TotalHoursByFacByDateByVol = @"<fetch aggregate='true'  no-lock='true'>
  <entity name='msnfpe_timeentry'>
    <attribute name='msnfpe_hours' alias='TH' aggregate='sum' />
    <filter>
      <condition attribute='cdcep_volunteerid' operator='eq' value='{0}' />
      <condition attribute='msnfpe_date' operator='on' value='{2}' />
    </filter>
    <link-entity name='cdcep_volunteerassignment' from='cdcep_volunteerassignmentid' to='cdcep_assignment_id' link-type='inner'>
      <filter type='or'>
        <condition attribute='cdcep_facilityid' operator='eq' value='{1}' />
        <condition attribute='cdcep_rootfacilityid' operator='eq' value='{1}' />
      </filter>
    </link-entity>
  </entity>
</fetch>";

        public const string timeEntryFiscalYearFetchXml = @"<fetch no-lock='true' aggregate='true'>
  <entity name='msnfpe_timeentry'>
    <attribute name='cdcep_volunteerid' alias='TotalTimeEntries' aggregate='count' />
    <attribute name='msnfpe_date' alias='FiscalYear' groupby='true' dategrouping='fiscal-year' />
    <attribute name='msnfpe_date' alias='FiscalPeriod' groupby='true' dategrouping='fiscal-period' />
    <attribute name='msnfpe_hours' alias='TotalHours' aggregate='sum' />
    <filter>
      <condition attribute='statuscode' operator='in'>
        <value>796500001</value>
        <value>2</value>
      </condition>
      <condition attribute='msnfpe_date' operator='in-fiscal-year' value='{1}' />
      <condition attribute='cdcep_volunteerid' operator='eq' value='{0}' uiname='Sarah Aaron' uitype='contact' />
    </filter>
    <order alias='FiscalYear' />
  </entity>
</fetch>";



